import React from 'react';
import "./Skeleton.css";

export default function() {
    return (
        <div id="skeleton">
            <div className="item-list narrow d-flex">
                <div className="left">
                    <div className="loading-sm"></div>
                    <div className="loading-sm"></div>
                    <div className="loading-sm"></div>
                </div>
                <div className="right">
                    <div className="loading"></div>
                    <div className="loading"></div>
                </div>
            </div>
        </div>
    )
}
